static void control_system_discretize(const real_T x_data[], const int32_T
  x_size[2], const emxArray_real_T_control_syste_T *edges, real_T bins_data[],
  int32_T *bins_size)
{
  int32_T b_jndx;
  int32_T b_kndx;
  int32_T n;
  int32_T u0;
  boolean_T exitg1;
  if (x_size[1] == 0) {
    n = 0;
  } else if (1 > x_size[1]) {
    n = 1;
  } else {
    n = x_size[1];
  }

  *bins_size = n;
  for (b_kndx = 0; b_kndx < n; b_kndx++) {
    bins_data[b_kndx] = 1.0;
  }

  if (x_size[1] == 0) {
    n = -1;
  } else {
    if (1 > x_size[1]) {
      b_kndx = 1;
    } else {
      b_kndx = x_size[1];
    }

    n = b_kndx - 1;
  }

  if (0 <= n) {
    if (edges->size[0] == 0) {
      u0 = 0;
    } else {
      u0 = edges->size[0];
      if (u0 <= 1) {
        u0 = 1;
      }
    }
  }

  for (b_kndx = 0; b_kndx <= n; b_kndx++) {
    b_jndx = 0;
    exitg1 = false;
    while ((!exitg1) && (b_jndx <= u0 - 2)) {
      if ((x_data[b_kndx] >= edges->data[b_jndx]) && (x_data[b_kndx] <
           edges->data[b_jndx + 1])) {
        bins_data[b_kndx] = (real_T)b_jndx + 1.0;
        exitg1 = true;
      } else {
        b_jndx++;
      }
    }
  }
}

