static boolean_T control_system_BFGSUpdate(int32_T nvar, real_T Bk[400], const
  emxArray_real_T_control_syste_T *sk, emxArray_real_T_control_syste_T *yk,
  emxArray_real_T_control_syste_T *workspace)
{
  real_T curvatureS;
  real_T dotSY;
  real_T temp;
  int32_T b_ix;
  int32_T b_jA;
  int32_T c_ix;
  int32_T d;
  int32_T ix;
  int32_T jy;
  boolean_T success;
  dotSY = 0.0;
  if (nvar >= 1) {
    for (b_jA = 0; b_jA < nvar; b_jA++) {
      dotSY += sk->data[b_jA] * yk->data[b_jA];
    }
  }

  for (b_jA = 0; b_jA < nvar; b_jA++) {
    workspace->data[b_jA] = 0.0;
  }

  ix = 0;
  jy = (nvar - 1) * 20;
  for (c_ix = 1; c_ix <= jy + 1; c_ix += 20) {
    b_ix = 0;
    d = (c_ix + nvar) - 1;
    for (b_jA = c_ix; b_jA <= d; b_jA++) {
      workspace->data[b_ix] += Bk[b_jA - 1] * sk->data[ix];
      b_ix++;
    }

    ix++;
  }

  curvatureS = 0.0;
  if (nvar >= 1) {
    for (ix = 0; ix < nvar; ix++) {
      curvatureS += sk->data[ix] * workspace->data[ix];
    }
  }

  if (dotSY < 0.2 * curvatureS) {
    dotSY = 0.8 * curvatureS / (curvatureS - dotSY);
    for (b_jA = 0; b_jA < nvar; b_jA++) {
      yk->data[b_jA] *= dotSY;
    }

    dotSY = 1.0 - dotSY;
    if (!(dotSY == 0.0)) {
      for (ix = 0; ix < nvar; ix++) {
        yk->data[ix] += dotSY * workspace->data[ix];
      }
    }

    dotSY = 0.0;
    if (nvar >= 1) {
      for (b_jA = 0; b_jA < nvar; b_jA++) {
        dotSY += sk->data[b_jA] * yk->data[b_jA];
      }
    }
  }

  success = ((curvatureS > 2.2204460492503131E-16) && (dotSY >
              2.2204460492503131E-16));
  if (success) {
    curvatureS = -1.0 / curvatureS;
    if (!(curvatureS == 0.0)) {
      ix = 0;
      jy = 0;
      for (c_ix = 0; c_ix < nvar; c_ix++) {
        if (workspace->data[jy] != 0.0) {
          temp = workspace->data[jy] * curvatureS;
          b_ix = 0;
          d = nvar + ix;
          for (b_jA = ix; b_jA < d; b_jA++) {
            Bk[b_jA] += workspace->data[b_ix] * temp;
            b_ix++;
          }
        }

        jy++;
        ix += 20;
      }
    }

    curvatureS = 1.0 / dotSY;
    if (!(curvatureS == 0.0)) {
      b_jA = 0;
      ix = 0;
      for (jy = 0; jy < nvar; jy++) {
        if (yk->data[ix] != 0.0) {
          dotSY = yk->data[ix] * curvatureS;
          c_ix = 0;
          b_ix = nvar + b_jA;
          for (d = b_jA; d < b_ix; d++) {
            Bk[d] += yk->data[c_ix] * dotSY;
            c_ix++;
          }
        }

        ix++;
        b_jA += 20;
      }
    }
  }

  return success;
}

