static void control_system_countsort(emxArray_int32_T_control_syst_T *x, int32_T
  xLen, emxArray_int32_T_control_syst_T *workspace, int32_T xMin, int32_T xMax)
{
  int32_T b_idxW;
  int32_T idxEnd;
  int32_T idxStart;
  int32_T maxOffset_tmp;
  if ((xLen > 1) && (xMax > xMin)) {
    maxOffset_tmp = xMax - xMin;
    for (idxStart = 0; idxStart <= maxOffset_tmp; idxStart++) {
      workspace->data[idxStart] = 0;
    }

    for (idxStart = 0; idxStart < xLen; idxStart++) {
      workspace->data[x->data[idxStart] - xMin]++;
    }

    for (idxStart = 1; idxStart < maxOffset_tmp + 1; idxStart++) {
      workspace->data[idxStart] += workspace->data[idxStart - 1];
    }

    idxStart = 0;
    idxEnd = workspace->data[0];
    for (b_idxW = 0; b_idxW < maxOffset_tmp; b_idxW++) {
      while (idxStart + 1 <= idxEnd) {
        x->data[idxStart] = b_idxW + xMin;
        idxStart++;
      }

      idxStart = workspace->data[b_idxW];
      idxEnd = workspace->data[b_idxW + 1];
    }

    while (idxStart + 1 <= idxEnd) {
      x->data[idxStart] = xMax;
      idxStart++;
    }
  }
}

