/* Function for MATLAB Function: '<S5>/MPC_cntr' */
static void control_system_linearForm_(boolean_T obj_hasLinear, int32_T obj_nvar,
  emxArray_real_T_control_syste_T *workspace, const real_T H[400], const
  emxArray_real_T_control_syste_T *f, const emxArray_real_T_control_syste_T *x)
{
  real_T c;
  int32_T b;
  int32_T b_c;
  int32_T fMultiplier;
  int32_T ia;
  int32_T iac;
  int32_T iy;
  fMultiplier = 0;
  if (obj_hasLinear) {
    while (fMultiplier <= obj_nvar - 1) {
      workspace->data[fMultiplier] = f->data[fMultiplier];
      fMultiplier++;
    }

    fMultiplier = 1;
  }

  if (obj_nvar != 0) {
    if (fMultiplier != 1) {
      while (fMultiplier <= obj_nvar - 1) {
        workspace->data[fMultiplier] = 0.0;
        fMultiplier++;
      }
    }

    fMultiplier = 0;
    b_c = (obj_nvar - 1) * obj_nvar + 1;
    iac = 1;
    while (((obj_nvar > 0) && (iac <= b_c)) || ((obj_nvar < 0) && (iac >= b_c)))
    {
      c = 0.5 * x->data[fMultiplier];
      iy = 0;
      b = (iac + obj_nvar) - 1;
      for (ia = iac; ia <= b; ia++) {
        workspace->data[iy] += H[ia - 1] * c;
        iy++;
      }

      fMultiplier++;
      iac += obj_nvar;
    }
  }
}

