static void control_system_solve(const s_C5zUoIuK89Wyj7kNfqdpED_cont_T *obj,
  emxArray_real_T_control_syste_T *rhs)
{
  real_T temp;
  int32_T b_j;
  int32_T c;
  int32_T ix;
  int32_T jjA;
  if (obj->ndims != 0) {
    for (b_j = 0; b_j < obj->ndims; b_j++) {
      c = b_j * obj->ldm;
      temp = rhs->data[b_j];
      for (ix = 0; ix < b_j; ix++) {
        temp -= obj->FMat->data[c + ix] * rhs->data[ix];
      }

      rhs->data[b_j] = temp / obj->FMat->data[c + b_j];
    }

    for (b_j = obj->ndims - 1; b_j + 1 > 0; b_j--) {
      jjA = b_j * obj->ldm + b_j;
      rhs->data[b_j] /= obj->FMat->data[jjA];
      for (c = 1; c - 1 < b_j; c++) {
        ix = b_j - c;
        rhs->data[ix] -= obj->FMat->data[jjA - c] * rhs->data[b_j];
      }
    }
  }
}

